import { Route, Routes } from "react-router-dom";
import { Suspense, lazy } from "react";
import Layout from "../../components/organisms/Layout/Layout";
const  Home = lazy(()=> import("../../Pages/Home/Home"));


const Log = () => {
    return (
        <>
            <Routes>
                <Route
                    exact
                    element={
                        <Layout />
                    }
                    children={
                        <Route
                            exact
                            path="/"
                            element={
                                <Suspense fallback={<div>...Skeleton</div>}>
                                   <Home></Home>
                                </Suspense>
                            }
                        />
                        
                    }
                />

            </Routes>
        </>
    );
};
export default Log;
